import { useRef } from 'react';
import Card from '../UI/Card';
import { useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import { styled } from '@mui/material/styles';
import ButtonBase from '@mui/material/ButtonBase';
import TextField from "@material-ui/core/TextField";

const Img = styled('img')({
  margin: 'auto',
  display: 'block',
  maxWidth: '100%',
  maxHeight: '100%',
  height:'237px'
});


const useStyles = makeStyles((theme) => ({
  dataClass:{
    maxWidth: "60rem",
    width: "90%",
    margin: "2rem auto",
    animation: "data-appear 1s ease-out forwards",
  },
}));

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  color: theme.palette.text.secondary,
}));

const AvailableData = () => {
  const data_classes = useStyles();
  const [isFetched, setIsFetched] = useState(false);
  const [userData, setUserData] = useState({});
  const [showDetails, setShowDetails] = useState(false);
  let heading_title;
  let employee_details;
  let founders_details;



    const nameInputRef = useRef();
    const urlInputRef = useRef();


  const submitHandler = (event) => {
    event.preventDefault();

  };

  const switchDetailModeHandler = async () => {

    const axios = require('axios').default;
    const url = urlInputRef.current.value;
    const name = nameInputRef.current.value;
    if (!isFetched){
      try {
        axios.get('http://localhost:4000/api/v1/company_profile', {
          params: {
            company_name: name,
            url:url
          }
        })
        .then(function (response) {
          setUserData(response.data)
          setIsFetched(true);
          setShowDetails(true);

        })
        .catch(function (error) {
          console.log(error);
        })
      } catch (error) {
        console.error(error);
        alert(error);
      }

    }
    else
    {
      if (showDetails){
      setShowDetails(false);
      }
      else{
        setShowDetails(true);
      }
    }

  };

  if (isFetched)
  {
    heading_title = (
    <div>
      <h2>{userData.company_detail.name}</h2>
      <p> {userData.company_detail.tagline}</p>
      <p>Followers:{userData.company_detail.followers}</p>
      <p>No of employees:{userData.company_detail.no_of_employees}</p>
    </div>
    );


      employee_details = userData.employee_details.map((user) => (
      <div>
        <Card>
          <Grid container spacing={2}>
            <Grid item md={8}>
